import Navbar from "../../components/Navbar";

class Index extends Component {
    static async getInitialProps({query}){
        console.log(query);
        return {}
    }


    render() {
        return (
            <div>
                <Navbar/>
               <h1>User Mofo</h1>
            </div>
        );
    }
}

export default Index;
